import React from "react"



const Tasks = (props) => {
    return <div>
        {
            props.ToDoListTasks.map(el => el.ListId === props.ListID && el.map(key =>{
                return <div>
                    {key.title}
                </div>
                })
            )
        }
    </div>
}

export default Tasks
